Este soneto satírico fue escrito por Francisco de Quevedo, quien vivió entre 1580 y 1645. El poema hace burla de la toma de Larache, una plaza africana que fue cedida a España por Muley Xeque en 1610. Quevedo utiliza un juego de palabras y dobles sentidos escatológicos para ridiculizar este acontecimiento histórico.
